			</text>
			<text id="Il-faut-régulièremen" font-family="OpenSans-Light, Open Sans" font-size="17" font-weight="300" line-spacing="32" fill="#000000">
				<tspan x="0" y="94">Il faut régulièrement le point pour vérifier l’atteinte des objectifs intermédiaire, </tspan>
				<tspan x="0" y="126">les adapter si nécessaire, soutenir sa motivation et se donner de nouveaux </tspan>
				<tspan x="0" y="158">défis.</tspan>
			</text>
			<path d="M1.5,233.5 L42,233.5" id="Line-5-Copy-4" stroke="#FF6F5A" stroke-linecap="square"></path>
			<text id="Est-ce-qu’ils-étaien" font-family="OpenSans-SemiBoldItalic, Open Sans" font-size="21" font-style="italic" font-weight="500" line-spacing="45" fill="#000000">
				<tspan x="72" y="230">Est-ce qu’ils étaient trop faciles/ trop difficiles ? </tspan>
				<tspan x="72" y="275">Est-ce que vous vous y êtes tenu, si non, pourquoi ? </tspan>
			</text>
		</g>
		<g id="Définir-des-méthodes" transform="translate(494.000000, 5635.000000)">
