				<tspan x="1" y="42">DÉFINIR DES MÉTHODES </tspan>
			</text>
			<text id="Une-fois-que-les-obj" font-family="OpenSans-Light, Open Sans" font-size="17" font-weight="300" line-spacing="32" fill="#000000">
				<tspan x="1" y="95">Une fois que les objectifs sont précisés, il reste à définir les méthodes qui vont </tspan>
				<tspan x="1" y="127">permettre de les atteindre.</tspan>
			</text>
			<text id="Qu’allez-vous-faire" font-family="OpenSans-SemiBoldItalic, Open Sans" font-size="21" font-style="italic" font-weight="500" line-spacing="45" fill="#000000">
