				<tspan x="1" y="475">Léa</tspan>
				<tspan x="29.3803711" y="475" font-family="OpenSans-Light, Open Sans" font-weight="300"> choisit de prendre des cours particuliers en SVT tous les lundis soir, </tspan>
				<tspan x="1" y="507" font-family="OpenSans-Light, Open Sans" font-weight="300">planifie des séances de révisions avec ses amies pour l’Histoire-Géo et décide </tspan>
				<tspan x="1" y="539" font-family="OpenSans-Light, Open Sans" font-weight="300">de lire le contenue de chaque cours d’histoire la veille de la classe pour être </tspan>
				<tspan x="1" y="571" font-family="OpenSans-Light, Open Sans" font-weight="300">déjà familiarisée avec son contenu et mieux le retenir.</tspan>
