	computed: {
		psmartStep: function() {
			return (this.psmart.minX - this.psmart.maxX) / this.psmart.numberOfItems;
		},
		psmartCurrentStep: function() {
			const i = Math.floor((this.psmart.progression - this.psmartStep / 2) / this.psmartStep) + 1;
			return i === -1 ? this.psmart.numberOfItems - 1 : i;
		},
		peopleStep: function() {
			return (this.people.minX - this.people.maxX) / this.people.numberOfItems;
		},
		peopleCurrentStep: function() {
			const i = Math.floor((this.people.progression - this.peopleStep / 2) / this.peopleStep) + 1;
			return i === -1 ? this.people.numberOfItems - 1 : i;
		}
	},

	methods: {

		showPersonaInfos: function(evt, id) {
			let el = evt.toElement;
			let xPos = (el.offsetLeft + el.clientLeft);
			let yPos = (el.offsetTop - el.scrollTop + el.clientTop);
			this.persona.current = id;
			this.persona.isVisible = 1;
			this.persona.position.top = yPos;
			this.persona.position.left = xPos - 20;
		},

		hidePersonaInfos: function() {
			this.persona.isVisible = 0;
		},

		psmartNext() {
			if (this.psmartCurrentStep < this.psmart.numberOfItems) {
				this.psmart.progression += this.psmartStep;
			}
		},

		psmartPrev() {
			if (this.psmartCurrentStep > 0) {
				this.psmart.progression -= this.psmartStep;
			}
		},

		peopleNext() {
			if (this.peopleCurrentStep < this.people.numberOfItems) {
				this.people.progression += this.peopleStep;
			}
		},

		peoplePrev() {
			if (this.peopleCurrentStep > 0) {
				this.people.progression -= this.peopleStep;
			}
		},

		setCurrentBilan(i) {
			this.currentBilan = i;
		},

		setCurrentBilanTab(i) {
			this.currentBilanTab = i;
		},

		setCurrentPlanning(i) {
			this.currentPlanning = i;
		},

		setCurrentMethods(i) {
			this.currentMethods = i;
		}

	},

	components: {
		bilanComp,
		bilanTabComp,
		planningComp,
		methodsComp
	}

};

</script>

